const user= localStorage.getItem('user');
const userJSON= JSON.parse(user)
const Products = () => {
    return (
        <React.Fragment>
              <div className="col-10 col-md-6 mx-auto">
                  <h3>Your products</h3>
                {userJSON?
                    userJSON.products.map((product)=>{
                        return(
                            <div className="row">
                                </div>
                           
                        )
                      
                    })
                    :
                    <h2>You have not uploaded any product</h2>
                }
               </div>
            
         
        </React.Fragment>
    )
}

export default Products
